def minion_game(string):
    # your code goes here
    vowel =['A','E','I','O','U']
    Stuart_dict = {}
    Kevin_dict = {}
    for i in range(1,len(string)+1):
        for j in range(0,len(string)):
            if len(string[j:j+i]) == i:
                # print(len(string[j:j+i]), i)
                # print(string[j:j+i])
                if string[j] in vowel:

                    if string[j:j+i] not in Kevin_dict.keys():
                        Kevin_dict[string[j:j+i]] = 1
                    else:
                        Kevin_dict[string[j:j+i]] += 1
                else:
                    if len(string[j:j+i]) == i:
                        if string[j:j+i] not in Stuart_dict.keys():
                            Stuart_dict[string[j:j+i]] = 1
                        else:
                            Stuart_dict[string[j:j+i]] += 1
    # print(Stuart_dict,Kevin_dict)
    Stuart_value = sum(Stuart_dict.values())
    Kevin_value = sum(Kevin_dict.values())
    if Kevin_value>Stuart_value:
        print("{} {}".format("Kevin",Kevin_value))
    elif Kevin_value<Stuart_value:
        print("{} {}".format("Stuart",Stuart_value))
    else:
        print("Draw")



s = ""
minion_game(s)
